css:
@-moz-document domain(docs.filecoin.io) {
    body {

        color: #ddd !important;

        background-color: #333 !important;

    }

    .sidebar, .navbar, .navbar .links, .custom-block.tip, .legacy-callout {

        background-color: #666 !important;

    }

    nav.fixed {

        background-color: #333 !important;

    }

    a, p a code {

        color: #71e3de !important;

    }

    .theme-default-content code {

        color: #f000f0;

    }

    .custom-block.callout, tr:nth-child(2n), .legacy-callout {

        background-color: #000 !important;

    }

    .custom-block.warning, .legacy-callout {

        color: inherit !important;

    }

    .custom-block.warning .custom-block-title {

        color: #FFFF00 !important;

    }

    .home .category {

        background:linear-gradient(-50deg, #666, #000) !important

    }
}
